import React from 'react';
import './components/Contact.css';
import './components/Contact.js';
let Contact = (props)=> <p>{props.msg}</p>

function App() {
  return (
    <div className="App">

      <Contact msg = "slt"/>

    </div>
  );
}

export default App;
